import React from 'react';

function App() {
  // Replace with your actual Google Drive URL (folder link)
  const googleDriveLink = "https://drive.google.com/drive/folders/1G_gnZ0sQYpaSiuqWtf518Ad-2rGHQZYl";

  return (
    <div style={{ textAlign: "center", marginTop: "50px" }}>
      <h1>Study Companion Frontend</h1>
      <p>Click one of the buttons below to open the Capstone folder on Google Drive:</p>
      <div>
        <button style={{ margin: "10px", padding: "10px 20px" }}>
          <a 
            href={googleDriveLink} 
            target="_blank" 
            rel="noopener noreferrer" 
            style={{ textDecoration: "none", color: "inherit" }}
          >
            Capstone Folder 1
          </a>
        </button>
        <button style={{ margin: "10px", padding: "10px 20px" }}>
          <a 
            href={googleDriveLink} 
            target="_blank" 
            rel="noopener noreferrer" 
            style={{ textDecoration: "none", color: "inherit" }}
          >
            Capstone Folder 2
          </a>
        </button>
        <button style={{ margin: "10px", padding: "10px 20px" }}>
          <a 
            href={googleDriveLink} 
            target="_blank" 
            rel="noopener noreferrer" 
            style={{ textDecoration: "none", color: "inherit" }}
          >
            Capstone Folder 3
          </a>
        </button>
      </div>
    </div>
  );
}

export default App;
